import Layout from '../components/Layout';

const Contact  = () => (

    <Layout>
        <div>
            <h1>Contact Page</h1>

            <img src="/contact.gif" alt="contact" />
            <p>
                This is some contact me text -- Not serious about this as I have a different portfolio in development
            </p>
        </div>
    </Layout>
)

export default Contact;
